import { useRef, useState } from "react";

function LoginPage() {
  const inEmail = useRef();
  const inPass = useRef();
  return (
    <div>
      <input ref={inEmail} type="text" placeholder="email" />
      <input ref={inPass} type="text" placeholder="pass" />

      <button on onClick={registerUser}>
        Login
      </button>
    </div>
  );
}

export default LoginPage;
